   const handleClick = ()=>{
    onDelete(book.id);
   }
   
   
   return <div className="grid">
         {book.title}
      <div className="cell">
        <button className="button is-danger" onClick ={handleClick}>
            Delete
            </button>
            </div> 
        </div>;
}
export default BookShow;
